import React from 'react';
import { Button } from '../Button';
import githubImage from '../images/github.webp';
import './../Button.css';
import styles from '../../App.css';

export default function GitHub() {
  return (
    <div className={styles.githubPage}>
      <img src={githubImage} alt="github" className="heroImage"/>
      <h1 className={styles.githubHeading}>GitHub</h1>
      <div>
        <Button buttonStyle="btn--outline" buttonSize="btn--large">Python Projects</Button>
      </div>
      <div>
        Java Projects
      </div>
      <div>
        GAS Projects
      </div>
      <div>
        R Projects
      </div>
      <div>
        PHP Projects
      </div>
    </div>
  );
}
